"original": |2-
     The Last-Modified message body header field indicates the date and
     time at which the origin server believes the presentation description
     or media stream was last modified.  For the DESCRIBE method, the
     header field indicates the last modification date and time of the
     description, for the SETUP of the media stream.
"fixed": |-
  The Last-Modified message body header field indicates the date and time at which the origin server believes the presentation description or media stream was last modified.  For the DESCRIBE method, the header field indicates the last modification date and time of the description, for the SETUP of the media stream.
"ko": |-
  Last-Modified 메시지 본문 헤더 필드는 원서버가 프레젠테이션 설명이나 미디어 스트림이 마지막으로 수정되었다고 믿는 날짜와 시간을 나타냅니다. DESCRIBE 메소드의 경우 헤더 필드는 미디어 스트림의 SETUP에 대한 설명의 마지막 수정 날짜 및 시간을 나타냅니다.
